import { NavLink } from 'react-router-dom';

function Header() {
  const navLinks = [
    ['Главная', '/'],
    ['Бани', '/bany'],
    ['Кухня', '/citchen'],
    ['Массаж', '/massages'],
    ['Контакты', '/contact']
  ];

  return (
    <header>
      <nav>
        <div>
            <img src="/img/" alt="" />
        </div>
        {navLinks.map(([title, url]) => (
          <NavLink
            key={title}           
            to={url}             
            className={({ isActive }) => 
              isActive ? 'active-link' : ''  
            }
          >
            {title}
          </NavLink>
        ))}
      </nav>
    </header>
  );
}

export default Header;
